.schedule {
  display: grid;
  grid: [row1-start] "header header header" 20% [row1-end] [row2-start] "now next future" 1fr [row2-end]/45% 1fr 1fr;
  grid-gap: 15px;
  font-size: 1.3em;
}

.event {
  display: grid;
  grid-template-rows: auto 1fr auto;
  align-items: center;
}
.event .time {
  grid-row: 3;
  justify-self: flex-end;
  align-self: flex-end;
  color: #e99456;
}
.event .text {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
  grid-row: 2;
}
.event .when {
  grid-row: 1;
  color: #e99456;
  font-size: 1.1em;
}
